description:
1. One of the most beneficial remedies is pulverized charcoal, placed in a bag and used in fomentations. This is a most successful remedy...To students when injured with bruised hands and suffering with inflammation, I have prescribed this simple remedy, with perfect success. The poison of inflammation was overcome, the pain removed, and healing went on rapidly. The most severe inflammation of the eyes will be relieved by a poultice of charcoal, put in a bag, and dipped in hot or cold water, as will best suit the case. This works like a charm.  {2SM 294.2} 
2. My mother had told me that snake bites and the sting of reptiles and poisonous insects could often be rendered harmless by the use of charcoal poultices.  {2SM 295.3}  
I will tell you a little about my experience with charcoal as a remedy. For some forms of indigestion, it is more efficacious than drugs. A little olive oil into which some of this powder has been stirred tends to cleanse and heal. I find it is excellent. {2SM 298.5}  
3.  "But this man who was suffering from inflammation of the bowels, sent for me to come to him. My husband and I decided that it would not do to move him. Fears were entertained that mortification had set in. Then the thought came to me like a communication from the Lord, to take pulverized charcoal, put water upon it, and give this water to the sick man to drink, putting bandages of the charcoal over the bowels and stomach...The result was that in half an hour there was a change for the better...The blessing of God had worked with the simple means used." {PH144 23.1}
